import React, { Component } from 'react'
import Count from './components/Count'
import { Button } from 'antd';
import './App.css';
export default class App extends Component {
    render() {
        return (
            <div>
                <Count/>
                <div className="App">
                <Button type="primary">Button</Button>
          </div>
            </div>
            
        )
    }
}
